import React, { useState, useEffect } from "react";
import { Grid, Card, CardContent, Typography, IconButton, CircularProgress, Dialog, DialogTitle, DialogContent, DialogActions, TextField, Button } from "@mui/material";
import { useFormik } from 'formik';
import * as Yup from 'yup';
import AddIcon from "@mui/icons-material/Add";
import EditIcon from "@mui/icons-material/Edit";
import DeleteIcon from "@mui/icons-material/Delete";

// Define a base URL for the API
const API_URL = 'http://0.0.0.0:3000/videos';

function Video() {
  const [videos, setVideos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [openDialog, setOpenDialog] = useState(false);
  const [currentVideo, setCurrentVideo] = useState({ id: null, title: '', link: '' });

  useEffect(() => {
    fetchVideos();
  }, []);

  const fetchVideos = async () => {
    try {
      const response = await fetch(API_URL);
      const data = await response.json();
      setVideos(data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching videos:', error);
      setLoading(false);
    }
  };

  const handleAddVideo = () => {
    setCurrentVideo({ id: null, title: '', link: '' });
    setOpenDialog(true);
  };

  const handleEditVideo = (video) => {
    setCurrentVideo(video);
    setOpenDialog(true);
  };

  const handleDeleteVideo = async (id) => {
    try {
      await fetch(`${API_URL}/${id}`, {
        method: 'DELETE',
      });
      setVideos(videos.filter(video => video.id !== id));
    } catch (error) {
      console.error('Error deleting video:', error);
    }
  };

  const handleDialogClose = () => {
    setOpenDialog(false);
    setCurrentVideo({ id: null, title: '', link: '' });
    formik.resetForm();
  };

  const handleDialogSave = async (values) => {
    const method = currentVideo.id ? 'PUT' : 'POST';
    const url = currentVideo.id ? `${API_URL}/${currentVideo.id}` : API_URL;

    try {
      const response = await fetch(url, {
        method,
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(values),
      });
      const data = await response.json();

      if (currentVideo.id) {
        setVideos(videos.map(video => (video.id === currentVideo.id ? data : video)));
      } else {
        setVideos([...videos, data]);
      }
      handleDialogClose();
    } catch (error) {
      console.error(`Error ${currentVideo.id ? 'updating' : 'adding'} video:`, error);
    }
  };

  const formik = useFormik({
    initialValues: currentVideo,
    enableReinitialize: true,
    validationSchema: Yup.object({
      title: Yup.string().required('Title is required'),
      link: Yup.string().url('Invalid URL format').required('Link is required'),
    }),
    onSubmit: (values) => {
      handleDialogSave(values);
    },
  });

  if (loading) {
    return <CircularProgress />;
  }

  return (
    <div>
      <Grid container spacing={3}>
        {videos.map((video) => (
          <Grid item xs={12} sm={6} md={4} lg={3} key={video.id}>
            <Card>
              <CardContent>
                <Typography variant="h6" component="div">
                  {video.title}
                </Typography>
                <Typography variant="body2" color="textSecondary" component="div">
                  {video.link}
                </Typography>
                <IconButton onClick={() => handleEditVideo(video)}>
                  <EditIcon />
                </IconButton>
                <IconButton onClick={() => handleDeleteVideo(video.id)}>
                  <DeleteIcon />
                </IconButton>
              </CardContent>
            </Card>
          </Grid>
        ))}
        <Grid item xs={12} sm={6} md={4} lg={3}>
          <Card>
            <CardContent>
              <IconButton onClick={handleAddVideo}>
                <AddIcon />
              </IconButton>
              <Typography variant="subtitle1" component="div">
                Add Video
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Dialog for Adding/Editing Video */}
      <Dialog open={openDialog} onClose={handleDialogClose}>
        <DialogTitle>{currentVideo.id ? 'Edit Video' : 'Add Video'}</DialogTitle>
        <form onSubmit={formik.handleSubmit}>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              name="title"
              label="Title"
              fullWidth
              value={formik.values.title}
              onChange={formik.handleChange}
              error={formik.touched.title && Boolean(formik.errors.title)}
              helperText={formik.touched.title && formik.errors.title}
            />
            <TextField
              margin="dense"
              name="link"
              label="Link"
              fullWidth
              value={formik.values.link}
              onChange={formik.handleChange}
              error={formik.touched.link && Boolean(formik.errors.link)}
              helperText={formik.touched.link && formik.errors.link}
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleDialogClose}>Cancel</Button>
            <Button type="submit">{currentVideo.id ? 'Save' : 'Add'}</Button>
          </DialogActions>
        </form>
      </Dialog>
    </div>
  );
}

export default Video;
